import React, { Component } from 'react'
import { Container, FormGroup } from 'reactstrap'

class PostForm extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
            title:'',
            body:''
        }
    }

    
    render() {
        return (
            <Container>
                <h1>Add Post</h1>
                <form>
                    <FormGroup>
                        <input type="text" 
                        className="form-control" name='title' placeholder="Title" />
                    </FormGroup>
                    <FormGroup>
                        <textarea type="text" className="form-control" name='title' placeholder="Body" ></textarea>
                    </FormGroup>
                </form>
            </Container>
        )
    }
}

export default PostForm
